import {
    createBrowserRouter,
    Outlet,
    RouterProvider,
} from "react-router-dom";
import Register from './pages/Register.tsx'
import Login from './pages/Login.tsx'
import Write from './pages/Write.tsx'
import Single from './pages/Single.tsx'
import Home from './pages/Home.tsx'
import NavBar from "./Component/NavBar.tsx";
import Footer from "./Component/Footer.tsx";

function layOut() {
    return ( 
    <>
        <NavBar/>

        <Outlet/>
        <Footer/>
        </>
    );
}
const router = createBrowserRouter([{
        path: "/",
        element: <layOut/> ,
        children: [{
                path: "/",
                element: < Home / >
            },
            {
                path: "/Write",
                element: < Write / >
            },
            {
                path: "/Single",
                element: < Single / >
            }
        ]
    },
    {
        path: "/Register",
        element: < Register / > ,
    },
    {
        path: "/Login",
        element: < Login / > ,
    },
    {
        path: "/Write",
        element: < Write / > ,
    },
    {
        path: "/Single",
        element: < Single / > ,
    },
    {
        path: "/Home",
        element: < Home / > ,
    },

]);

function App() {
    return ( <
        div >
        <
        RouterProvider router = { router }
        />    </div >
    );
}

export default App;
